import { useEffect, useState } from "react";

export default function News(){
    var [results,setResults]=useState([])
    useEffect(()=>{
        axios.get("https://newsdata.io/api/1/latest?apikey=pub_48205f4fe927256206346a5098a9186e4b689&")
        .then((res)=>{
            setResults(res.data.results[0])
        })
    })
    return(
    <>
    <h3>{results.title}</h3>
    </>);
}
